Abdomen
: Third and fourth tergite dark brown anteriorly, spot anteromedially, triangles laterally; fifth tergite with silver transverse band posteriorly and two triangles lateromedially (
Fig. 2
). Male genitalia (
Figs. 14–15
) uncus with very short, lateral setae; uncus tip not prominent. Androconial organ on parateguminal sclerite oblong, ear-shaped (
Fig. 25–26
) with petaloid (
ps
) and filiform scales (
fs
). Valva with fibula, or sclerotized, thin, finger-like process only slightly extending beyond saccular margin, sclerotized from saccular margin to center of valva. Juxta medially with a single rod-like structure perpendicular to another rod-like structure. Phallus with vesica proximally covered with two prominent lines of spinules, without large spines. Female genitalia (
Fig. 21
) ductus bursae with a square-like antrum about 
2 mm
in width, followed by a lightly sclerotized band and two triangular sclerotized structures within that are wider than the band, remainder membranous, almost same width to corpus bursae. Corpus bursae membranous, oval, signum small, round. Ductus seminalis originating about halfway between ostium bursae and corpus bursae.

